import React from 'react';
import './App.css';


const sudoku = [];




class RowOfFields extends React.Component{

  render(){

    return(
      <div class="row">

        <div className="field"></div>
        <div className="field"></div>
        <div className="field"></div>

      </div>
    )
  }
}


class RowOfSquares extends React.Component{

  render(){

    return(
      <div className="row">

        <div className="square"> <RowOfFields/> <RowOfFields/> <RowOfFields/> </div>
        <div className="square"> <RowOfFields/> </div>
        <div className="square"> <RowOfFields/> </div>

      </div>
    )
  }
}


class Sudoku extends React.Component{

  render(){

    return(
      <div className="sudoku">

        <RowOfSquares/>
        <RowOfSquares/>
        <RowOfSquares/>

      </div>
    )

  }
}



function App() {
  return (
    <div className="App">

      <Sudoku/>

    </div>
  );
}

export default App;
